import React from "react";
import patientIcon from './images/patientIcon.png';
import Perscription from './startPerscription';


function Med (props) {

  return (
    <button
        className="perscription"
        style = {{
            position:'absolute',
            padding: '4px',
            paddingLeft: '9px',
            paddingRight: '9px',
            borderRadius: '10px',
            color: 'black',
            fontSize: '12pt',
            borderColor: 'black',
            height: '45px',
            width: 'auto',
            display: "inline-block",
        }} 
            > <b>{props.formula}</b>
    </button>  
  );
};

export default Med;
